import React from 'react';
import { useLoginState, useLoginDispatchState } from '../../contexts/loginContext';

const Login = (props) => {
    const [myState , setMyState ] = React.useState();
    const emailRef = React.createRef();
    const passwordRef = React.creatRef();

    const handleSubmit =( ev ) => {
        ev.preventDefault();
    }

    return (
        <div className="login-container">
            <div className="login">
                <h1> Login page </h1>
                <form className="form" onSubmit={handleSubmit}>
                    <div className="form-input">
                        <label className="label" htmlFor="email"> Email </label>
                        <input type="text"  id="email" className="form-control" placeholder="Entrez votre email " required />
                    </div>
                    <div className="form-input">
                        <label className="label" htmlFor="password"> Password </label>
                        <input type="text"  id="password" className="form-control" placeholder="Entrez votre password " required />
                    </div>
                    <div className="form-group">
                        <button type="submit" className="login-btn"> Login </button>
                    </div>
                </form>
            </div>
        </div>
    )
}

export default Login;
